  return (
    <FlashcardList flashcards={cards} />
  );
}

const SAMPLE_CARDS = [
  {
    id: 1,
    question: 'Capital of France',
    answer: 'Paris',
    options: ['London', 'Paris', 'Barcelona']
  },
